import {ListItem} from "../ListItem";

export const ManagerList = (props) => {
    const { managerList } = props;
    return (
        <div>
            { managerList.map((value) => {
                return <ListItem>{value.firstName} {value.lastName}</ListItem>
            })}
        </div>
    );
}
